import React, {Component} from 'react';
import '../css/pages/details.css';
import Header from '../components/header'
import Footer from '../components/footer'
import '../css/pages/product.css';
import {Link} from 'react-router-dom';


class Details extends Component {
    render() {
        return (
            <div className="Details">
                <Header/>
                <div className="details-container">
                    <div className="w3-row">
                        <div className="w3-col s12 m6 l6 ">
                            <img src={require('../assets/images/Vegetables.jpg')} alt=""/>
                        </div>
                        <div className="w3-col s12 m6 l6 ">
                           <div className='product-details'>
                               <h1>Vegetables</h1>
                               <h5>$56</h5>
                               <h4>Quantity</h4>
                               <input className='input-quantity' type="number" value=''/>
                               <Link to={''} className="add-cart">ADD TO CART</Link>
                               <h4>Description</h4>
                               <hr/>
                               <p>This is the best veges in the country</p>
                               <hr/>
                           </div>
                        </div>
                    </div>
                </div>
                <Footer/>
            </div>
        );
    }
}

export default Details;
